package dataBase;

import java.sql.Connection;
import java.sql.DriverManager;
import java.sql.SQLException;
import java.sql.Statement;
import java.util.Properties;

public class DataBase {
	
	/**
	 * Metoda s³u¿y do po³¹czenia z MySQL bez wybierania konkretnej bazy
	 * 
	 * @return referencja do uchwytu bazy danych
	 */
	public static Connection getConnection(String adres, int port) {

		Connection conn = null;
		Properties connectionProps = new Properties();
		connectionProps.put("user", "root");
		connectionProps.put("password", "");

		try {
			conn = DriverManager.getConnection("jdbc:mysql://" + adres + ":" + port + "/", connectionProps);
		} catch (SQLException e) {
			e.printStackTrace();
		}
		System.out.println("Connected to database");
		return conn;
	}

	private static Statement createStatement(Connection connection) {
		try {
			return connection.createStatement();
		} catch (SQLException e) {
			e.printStackTrace();
		}
		;
		return null;
	}

	private static int executeUpdate(Statement s, String sql) {
		try {
			return s.executeUpdate(sql);
		} catch (SQLException e) {
		}
		return -1;
	}

	public DataBase() throws SQLException {
		// TODO Auto-generated constructor stub
		
		Connection con = getConnection("localhost", 3306);
		Statement st = createStatement(con);

		// utworzenie bazy
		if (executeUpdate(st, "create Database Massive;") != -1)
			System.out.println("Baza utworzona");
		else
			System.out.println("Baza nieutworzona!");

		if (executeUpdate(st, "USE Massive;") != -1)
			System.out.println("Baza wybrana");
		else
			System.out.println("Baza niewybrana!");

		if (executeUpdate(st,
				"CREATE TABLE User ( idUser INT NOT NULL AUTO_INCREMENT, LOGIN VARCHAR(50) NOT NULL, "
				+ "PASSWORD VARCHAR(50) NOT NULL, PRIMARY KEY (idUser) );") != -1)
			System.out.println("Zapisano dane usera!");
		else
			System.out.println("Nie zapisano danych usera!");

		if (executeUpdate(st, "INSERT INTO User (LOGIN, PASSWORD) VALUES ('test', 'test');") != -1) {
			System.out.println("User utworzony");
		} else
			System.out.println("User nie utworzony!");
		
		if (executeUpdate(st,
				"CREATE TABLE Avatar ( idAvatar INT NOT NULL AUTO_INCREMENT , src BLOB NOT NULL , "
				+ "PRIMARY KEY (idAvatar) );") != -1)
			System.out.println("Avatar utworzona");
		else
			System.out.println("Avatar nie utworzona!");
		
		//santa
		if (executeUpdate(st, "INSERT INTO avatar (idAvatar, src) VALUES (NULL, );") != -1) {
			System.out.println("Dodano avatar");
		} else
			System.out.println("Nie dodano avatara!");
		//cisatek
		if (executeUpdate(st, "INSERT INTO `avatar` (`idAvatar`, `src`) VALUES (NULL, );") != -1) {
			System.out.println("Dodano Avatara");
		} else
			System.out.println("Nie dodano Avatara!");
		//ba³wan
		if (executeUpdate(st, "INSERT INTO `avatar` (`idAvatar`, `src`) VALUES (NULL, );") != -1) {
			System.out.println("Dodano Avatara");
		} else
			System.out.println("Nie dodano Avatara!");

		if (executeUpdate(st,
				"CREATE TABLE Champion ( idChampion INT NOT NULL AUTO_INCREMENT, idUser INT NOT NULL, idAvatar INT NOT NULL,"
				+ " IMIE VARCHAR(50) NOT NULL, KLASA VARCHAR(50) NOT NULL, PRIMARY KEY (idChampion), "
				+ "FOREIGN KEY(idUser) REFERENCES User(idUser) ON DELETE CASCADE ON UPDATE CASCADE, "
				+ "FOREIGN KEY(idAvatar) REFERENCES Avatar(idAvatar) ON DELETE CASCADE ON UPDATE CASCADE);") != -1)
			System.out.println("Champion utworzona");
		else
			System.out.println("Champion nie utworzony!");

		st.close();
		con.close();
	}
	
	public static void main(String[] arq) throws SQLException{
		
		new DataBase();
	}
}
